import React from 'react';
import { Link } from 'react-router-dom';

function Home(props) {
    return (
        <div>
            <ul>
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
                <Link to="/shop">Shop</Link>
                <Link to="/product">Products</Link>
            </ul>
        </div>
    );
}

export default Home;
